import Header from './Header.js';
import Main from './Main.js';
import Footer from './Footer.js';
import ImagePopup from './ImagePopup.js';
import PopupWithForm from './PopupWithForm.js';

function App() {
    function handleEditProfileClick() {
        const profilePopup = document.querySelector('.popup_type_profile');
        profilePopup.classList.add('popup_opened')
    }

    function handleaddPlaceClick() {
        const profilePopup = document.querySelector('.popup_type_places');
        profilePopup.classList.add('popup_opened')
    }

    function handleEditAvatarClick() {
        const profilePopup = document.querySelector('.popup_type_avatar');
        profilePopup.classList.add('popup_opened')
    }

  return (
    <div class="page">
        <Header />
        <Main
        openProfilePopup={handleEditProfileClick}
        openPlacePopup={handleaddPlaceClick}
        openAvatarPopup={handleEditAvatarClick} />
        <Footer />
        <PopupWithForm 
            title={"Редактировать профиль"} buttonSave={"Сохранить"}
            name={"type_profile"} form={"form_profile"}>
            <input
                className="popup__input popup__input_type_name" required
                type="text" name="name" value="name" id="input-name"
                minlength="2" maxlength="40" placeholder="Имя пользователя"/>
            <span className="input-name-error popup__span"></span>
            <input
                className="popup__input popup__input_type_about" required
                type="text" name="about" value="about" id="input-about"
                minlength="2" maxlength="200" placeholder="Информация о пользователе"/>
            <span className="input-about-error popup__span"></span>
        </PopupWithForm>
        <PopupWithForm 
            title={"Новое место"} buttonSave={"Создать"}
            name={"type_places"} form={"form_places"}>
            <input
                className="popup__input popup__input_type_place" required
                type="text" name="place" value="" id="input-place"
                minlength="2" maxlength="30" placeholder="Название"/>
            <span className="input-place-error popup__span"></span>
            <input
                className="popup__input popup__input_type_src" required
                type="url" name="link" value="" id="input-src"
                placeholder="Ссылка на картинку"/>
            <span className="input-src-error popup__span"></span>
        </PopupWithForm>




    <div class="popup popup_type_avatar">
        <div class="popup__container popup__container_avatar">
            <button type="button" class="popup__button-close"></button>
            <h2 class="popup__text popup__text_avatar">Обновить аватар</h2>
            <form class="popup__form popup__form_avatar" name="popup-avatar" novalidate>
                <input type="url" name="avatar" id="input-avatar" 
                    class="popup__input popup__input_type_avatar" 
                    placeholder="Ссылка на картинку" required />
                <span class="input-avatar-error popup__span">Введите адрес сайта</span>
                <button type="submit" class="popup__button popup__button_avatar">Сохранить</button>
            </form>
        </div>
    </div>
    <ImagePopup />

    <div class="popup popup_type_delete">
        <div class="popup__container popup__container_delete">
            <button type="button" class="popup__button-close"></button>
            <h2 class="popup__text popup__text-delete">Вы уверены?</h2>
            <button type="submit" class="popup__button popup__button_delete">Да</button>
        </div>
    </div>
</div>
  );
}

export default App;
